INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3.414, "カリン", 0.0, -416.5, 62, "2025/01/31 12:00:00", 2, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 190803, 1000001, 1, 1, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3.099, "カリン", 0.0, -416.5, 62, "2025/01/31 12:00:00", 2, "ミッションをクリアして、\n報酬をゲットしましょう！", 190803, 1000002, 1, 1, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2.801, "カリン", 0.0, -416.5, 63, "2025/01/31 12:00:00", 2, "受け取ることができる\n報酬があるようです\n確認してみてください", 190803, 1000003, 1, 1, "2030/01/01 14:59:59", 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (0.0, "カリン", 0.0, -416.5, 63, "2025/01/31 12:00:00", 2, "報酬がもらえますよ！\nチェックしてみてください", 190803, 1000004, 2, 1, "2030/01/01 14:59:59", 4);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2.12, "カリン", 0.0, -363.0, 64, "2025/01/31 12:00:00", 1, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 190803, 1000005, 2, 1, "2030/01/01 14:59:59", 5);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1.68, "カリン", 0.0, -363.0, 64, "2025/01/31 12:00:00", 2, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 190803, 1000006, 1, 1, "2030/01/01 14:59:59", 6);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2.33, "カリン", 0.0, -363.0, 64, "2025/01/31 12:00:00", 1, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 190803, 1000007, 2, 1, "2030/01/01 14:59:59", 7);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (5.18, "ラビリスタ", -6.0, -285.0, 61, "2025/01/31 12:00:00", 7, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 133701, 1020101, 3, 10201, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8.77, "クリスティーナ", -2.0, -285.0, 61, "2025/01/31 12:00:00", 2, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 133901, 1020102, 1, 10201, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (15.5, "ネネカ", 0.0, -285.0, 61, "2025/01/31 12:00:00", 1, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 133801, 1020103, 6, 10201, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (9.061, "ランファ", 0.0, -285.0, 61, "2025/02/28 12:00:00", 5, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 134301, 1020201, 2, 10202, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7.699, "チカ", 0.0, -285.0, 61, "2025/02/28 12:00:00", 2, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 134401, 1020202, 1, 10202, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8.595, "アオイ", 0.0, -285.0, 61, "2025/03/31 12:00:00", 2, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 134601, 1020301, 1, 10203, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7.758, "クローチェ", 0.0, -285.0, 61, "2025/03/31 12:00:00", 2, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 134501, 1020302, 1, 10203, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7.0, "ルイズマリー", 0.0, -285.0, 61, "2025/04/30 12:00:00", 6, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 132302, 1020401, 2, 10204, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7.904, "イロハ", 0.0, -285.0, 61, "2025/04/30 12:00:00", 2, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 132402, 1020402, 1, 10204, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8.487, "ソノ", 0.0, -285.0, 61, "2025/04/30 12:00:00", 2, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 132502, 1020403, 4, 10204, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8.763, "カノン", 0.0, -285.0, 61, "2025/05/31 12:00:00", 2, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 134901, 1020502, 1, 10205, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (6.417, "ツムギ", 0.0, -285.0, 61, "2025/05/31 12:00:00", 3, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 134801, 1020503, 1, 10205, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (10.335, "エリス", 0.0, -285.0, 61, "2025/06/30 12:00:00", 7, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 135001, 1020601, 3, 10206, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (6.281, "シェフィ", 0.0, -285.0, 61, "2025/06/30 12:00:00", 4, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 135101, 1020602, 2, 10206, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (12.244, "プレシア", 0.0, -285.0, 61, "2025/06/30 12:00:00", 2, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 135201, 1020603, 1, 10206, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (6.339, "クリア", 0.0, -285.0, 61, "2025/07/31 12:00:00", 8, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 135301, 1020701, 2, 10207, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8.184, "アネモネ", 0.0, -285.0, 61, "2025/07/31 12:00:00", 9, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 135401, 1020702, 7, 10207, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3.906, "アイラ", 0.0, -285.0, 61, "2025/08/31 12:00:00", 2, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 129101, 1020801, 9, 10208, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (14.465, "シナツ", 0.0, -285.0, 61, "2025/08/31 12:00:00", 2, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 129201, 1020802, 1, 10208, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8.662, "ヒヨリ", 0.0, -285.0, 61, "2025/08/31 12:00:00", 3, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 100101, 1020803, 4, 10208, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (10.915, "レイ", 0.0, -285.0, 61, "2025/08/31 12:00:00", 3, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 100301, 1020804, 1, 10208, "2030/01/01 14:59:59", 401);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (6.042, "ユキノ", 0.0, -285.0, 61, "2025/09/30 12:00:00", 7, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 135802, 1020901, 1, 10209, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (9.402, "サツキ", 0.0, -285.0, 61, "2025/09/30 12:00:00", 1, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 135903, 1020902, 4, 10209, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8.16, "ルルィ", 0.0, -285.0, 61, "2025/09/30 12:00:00", 1, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 136902, 1020903, 8, 10209, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (5.0, "カスミ", 0.0, -285.0, 61, "2025/10/31 12:00:00", 2, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 137401, 1021001, 3, 10210, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8.12, "アラクネ", 0.0, -285.0, 61, "2025/10/31 12:00:00", 1, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 136001, 1021002, 4, 10210, "2030/01/01 14:59:59", 201);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (6.386, "ナーナ", 0.0, -285.0, 61, "2025/10/31 12:00:00", 2, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 136202, 1021003, 4, 10210, "2030/01/01 14:59:59", 301);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7.438, "ユイ", 0.0, -285.0, 61, "2025/11/30 12:00:00", 4, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 136402, 1021101, 3, 10211, "2030/01/01 14:59:59", 101);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8.35, "ミソラ", 0.0, -285.0, 61, "2025/11/30 12:00:00", 5, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 136302, 1021102, 1, 10211, "2030/01/01 14:59:59", 201);
